    <button className={classes.button}>
      {/* <CartIcon /> */}
      <CartIcon className={classes.icon} />
      <p>
        Your Cart

      </p>
      <div className={classes.badge}>
        {dummyCartCount}
      </div>
    </ button>
  );
};

export default HeaderCartButton;
